BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `TheoryIndex` (
	`ID`	INTEGER NOT NULL UNIQUE,
	`PTO`	INTEGER NOT NULL,
	`FNS`	TEXT NOT NULL,
	`DAMP`	INTEGER NOT NULL,
	`IC`	INTEGER NOT NULL,
	`ModEv`	TEXT NOT NULL,
	`XIR`	REAL NOT NULL,
	`XIF`	REAL NOT NULL,
	`NfFF`	INTEGER NOT NULL,
	`MaxNfAs`	INTEGER NOT NULL,
	`MaxNfPdf`	INTEGER NOT NULL,
	`Q0`	REAL NOT NULL,
	`alphas`	REAL NOT NULL,
	`Qref`	REAL NOT NULL,
	`QED`	INTEGER NOT NULL,
	`alphaqed`	REAL NOT NULL,
	`Qedref`	REAL NOT NULL,
	`SxRes`	INTEGER NOT NULL,
	`SxOrd`	TEXT NOT NULL,
	`HQ`	TEXT NOT NULL,
	`mc`	REAL NOT NULL,
	`Qmc`	REAL NOT NULL,
	`kcThr`	REAL NOT NULL,
	`mb`	REAL NOT NULL,
	`Qmb`	REAL NOT NULL,
	`kbThr`	REAL NOT NULL,
	`mt`	REAL NOT NULL,
	`Qmt`	REAL NOT NULL,
	`ktThr`	REAL NOT NULL,
	`CKM`	TEXT NOT NULL,
	`MZ`	REAL NOT NULL,
	`MW`	REAL NOT NULL,
	`GF`	REAL NOT NULL,
	`SIN2TW`	REAL NOT NULL,
	`TMC`	INTEGER NOT NULL,
	`MP`	REAL NOT NULL,
	`Comments`	TEXT,
	PRIMARY KEY(`ID`),
	CHECK(MP>0),
	CHECK(TMCIN(0,1)),
	CHECK(SIN2TW>0ANDSIN2TW<1),
	CHECK(GF>0),
	CHECK(MW>0),
	CHECK(MZ>0),
	CHECK(ktThr>=0),
	CHECK(Qmt>=0),
	CHECK(mt>0),
	CHECK(kbThr>=0),
	CHECK(Qmb>=0),
	CHECK(mb>0),
	CHECK(kcThr>=0),
	CHECK(Qmc>=0),
	CHECK(mc>0),
	CHECK(HQIN('POLE','MSBAR')),
	CHECK(SxOrdIN('LL','NLL','NNLL')),
	CHECK(SxResIN(0,1)),
	CHECK(Qedref>0),
	CHECK(alphaqed>0ANDalphaqed<1),
	CHECK(QEDIN(0,1)),
	CHECK(Qref>0),
	CHECK(alphas>0ANDalphas<1),
	CHECK(Q0>0),
	CHECK(MaxNfPdfIN(3,4,5,6)),
	CHECK(MaxNfAsIN(3,4,5,6)),
	CHECK(NfFFIN(3,4,5,6)),
	CHECK(XIF>0),
	CHECK(XIR>0),
	CHECK(ModEvIN('EXA','EXP','TRN')),
	CHECK(ICIN(0,1)),
	CHECK(DAMPIN(0,1)),
	CHECK(FNSIN('FFNS','ZM-VFNS','FONLL-A','FONLL-B','FONLL-C')),
	CHECK(PTOIN(0,1,2))
);

COMMIT;

